import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Home from './routes/home/home.js';

function App() {
  return (
    <>
    <Router>
      <Switch>
        <Route exact path = "/"><Home></Home></Route>
      </Switch>
    </Router>
    </>
  );
}

export default App;
